@leahmcelrath I don’t envy you gaming this out. 

I remember the unhinged, incandescent rage my malignant narc mother rained upon me—which bled over to her sister, who sent people after me when my mother died. (I had to get a bodyguard for my own mother’s memorial.)

This is going to be ugly.
